import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // 1. Click on the first product to open the detail modal
    const firstProduct = page.locator('.product-card').first();
    await firstProduct.waitFor({ state: 'visible' });
    await firstProduct.click();

    // 2. Wait for the product detail modal to be visible
    const productModal = page.locator('#productModal');
    await productModal.waitFor({ state: 'visible' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // 3. Click the "Add to Wish List" button inside the modal
    const addToWishlistButton = productModal.locator('button.add-to-wishlist');
    await addToWishlistButton.click();

    // 4. Wait for the success notification
    const successNotification = page.locator('.notification.success');
    await successNotification.waitFor({ state: 'visible' });
    const notificationText = await successNotification.textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_notification.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_notification.png'));

    // 5. Verify the item was added to the wishlist in localStorage
    const wishlistData = await page.evaluate(() => {
      const wishlist = localStorage.getItem('amazonWishlist');
      return wishlist ? JSON.parse(wishlist) : null;
    });

    if (!wishlistData || wishlistData.length === 0) {
      throw new Error('Wishlist in localStorage is empty or not found.');
    }

    return {
      success: true,
      action: "Added a product to the wishlist and verified the success notification and localStorage update.",
      extractedData: {
        notification: notificationText,
        wishlistItemCount: wishlistData.length,
        firstWishlistItem: wishlistData[0]
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Capture a screenshot on failure
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
